import React, { useEffect, useState } from "react";
import { userForm } from "./Fetch";
import css6 from "./Task6.module.css";

function Task6() {
  const [loadingData, setLoadingData] = useState(null);

  useEffect(() => {
    const data = userForm([]);
    setLoadingData(data);
  }, []);

  return (
    <div className={css6.card}>
      <h3>Task 6</h3>
      <ul>
        {data.map((item) => (
          <li>item.name</li>
        ))}
      </ul>
    </div>
  );
}

export default Task6;

